import React, { Component } from 'react';
import {robots} from './robots';
import CardList from './CardList';
import SearchBox from './SearchBox';



class App extends Component{
  constructor(){
      this.state = {
      robots: robots,
      searchfield: ''
    }
  }
  render(){
    return (
      <div className='tc'>
        <h1>Robot Friends</h1>
        <SearchBox />
        <CardList robots={robots} />
      </div>
    );
  }
}

export default App;
